import React, { useState, useContext } from 'react'
import { AppContext } from '../App';
import { Link } from "react-router-dom"

function Address({ address }) {
    const [addressObj, setAddressObj] = { address }
    return (
        <div>
            <div className="list-group">
                <ul className="list-group list-group-flush">
                    <li className="list-group-item">Street      :       {addressObj.street}</li>
                    <li className="list-group-item">Suite       :       {addressObj.suite}</li>
                    <li className="list-group-item">City        :       {addressObj.city}</li>
                    <li className="list-group-item">Zipcode     :       {addressObj.zipcode}</li>
                    <li className="list-group-item">Geo         : </li>
                    <li className="list-group-item">Lat         :       {addressObj.geo.lat}</li>
                    <li className="list-group-item">lng         :       {addressObj.geo.lng}</li>
                    <li className="list-group-item"><Link to='/'>Go Back</Link></li>
                </ul>
            </div>


        </div>
    )
}

export default Address;
